  const [login, setLogin] = useState(false)
  const loginHandler = () => {
    setLogin(true)
    console.log('login')
  }

  return (
    <Fragment>
      <Header />
      <Auth onLogin={loginHandler}/>
      <Counter />

    </Fragment>
  );
}

export default App;
